import React from 'react';
import {navigation} from "../app_data/header_array";

class Header extends React.Component{
    render() {
        return(
            <header id={"app_header"}>
                <img src={"../../../public/images/realtor.png"}/>
                <div className={"navigation"}>
                    <ul>
                        {navigation.map((main_nav_item, i) => {
                            return(
                                <li key={i}>
                                   <h4>{main_nav_item.label}</h4>
                                    <ul>
                                        {main_nav_item.inner_menu.map((inner_nav_item) => {
                                            return inner_nav_item.map((list_item, j) => {
                                                return <li key={j}>
                                                    {list_item.href ? <a href={list_item.href}>{list_item.title}</a> : <h3>{list_item.title}</h3>}
                                                </li>
                                            })}
                                        )}
                                    </ul>
                                </li>
                            )
                        }
                        )}
                    </ul>
                </div>
            </header>
        )
    }
}

export default Header;
